#include "snake.h"

void init_allegro() {
    allegro_init();
    allegro_message("Allegro version: %s\n", allegro_version());
    srand(time(NULL));
    set_color_depth(32);
    set_gfx_mode(GFX_AUTODETECT, WINDOW_WIDTH, WINDOW_HEIGHT, 0, 0);
