}

void draw_grid() {
    for (int i = 0; i <= WINDOW_WIDTH / GRID_SIZE; i++) {
        draw_line(i * GRID_SIZE, 0, i * GRID_SIZE, WINDOW_HEIGHT);
        draw_line(0, i * GRID_SIZE, WINDOW_WIDTH, i * GRID_SIZE);
    }
}

void draw_snake(int *snake) {
    for (int i = 0; i < 100; i++) {
        rectfill(snake[i * 2], snake[i * 2 + 1], SNAKE_SIZE, SNAKE_SIZE, makecol(0, 255, 0));
    }
}

void draw_food(int food_x, int food_y) {
    rectfill(food_x, food_y, SNAKE_SIZE, SNAKE_SIZE, makecol(255, 0, 0));
}

void draw_score(int score) {
    char text[20];
    sprintf(text, "Score: %d", score);
    draw_text(text, 10, 10);
}

void update_snake(int *snake, int direction) {
    for (int i = 0; i < 100; i++) {
        if (i == 0) {
            switch (direction) {
                case UP:
                    snake[i * 2]--;
                    break;
                case DOWN:
                    snake[i * 2]++;
                    break;
                case LEFT:
                    snake[i * 2]--;
                    break;
                case RIGHT:
                    snake[i * 2]++;
                    break;
            }
        } else {
            snake[i * 2] = snake[(i - 1) * 2];
        }
    }
}

int check_collision(int *snake) {
    for (int i = 1; i < 100; i++) {
        if (snake[i * 2] == snake[0] && snake[i * 2 + 1] == snake[0 + 2]) {
            return 1;
        }
    }
    if (snake[0] < 0 || snake[0] >= WINDOW_WIDTH || snake[0 + 1] < 0 || snake[0 + 1] >= WINDOW_HEIGHT) {
        return 1;
    }
    return 0;
}

void draw_window() {
    clear_to_color(0, 0, 0);
