void handle_events() {
    if (key[KEY_UP] && direction!= DOWN) {
        direction = UP;
    }
    if (key[KEY_DOWN] && direction!= UP) {
        direction = DOWN;
    }
    if (key[KEY_LEFT] && direction!= RIGHT) {
        direction = LEFT;
    }
    if (key[KEY_RIGHT] && direction!= LEFT) {
        direction = RIGHT;
    }
}

int main() {
    int direction = RIGHT;
    int snake[200];
    for (int i = 0; i < 100; i++) {
        snake[i * 2] = GRID_SIZE * 10;
        snake[i * 2 + 1] = GRID_SIZE * 10;
    }
    int food_x = rand() % (WINDOW_WIDTH / GRID_SIZE) * GRID_SIZE;
    int food_y = rand() % (WINDOW_HEIGHT / GRID_SIZE) * GRID_SIZE;
    int score = 0;
    int i = 0;
    init_allegro();
    while (!key[KEY_ESCAPE]) {
        draw_window();
        update_snake(snake, direction);
        if (snake[0] == food_x && snake[1] == food_y) {
            food_x = rand() % (WINDOW_WIDTH / GRID_SIZE) * GRID_SIZE;
            food_y = rand() % (WINDOW_HEIGHT / GRID_SIZE) * GRID_SIZE;
            score++;
            snake[i * 2] = snake[(i - 1) * 2];
            snake[i * 2 + 1] = snake[(i - 1) * 2 + 1];
            i++;
        }
        if (check_collision(snake)) {
            break;
        }
        handle_events();
    }
    allegro_exit();
    return 0;
}
