#include <sstream>
#include <string>
#include <cctype>

// Function to count occurrences of a word in a file
int countWordOccurrence(const std::string& word, const std::string& filename) {
    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Error: Unable to open file." << std::endl;
        return -1; // Return error code
    }

    int occurrences = 0;
    std::string line;
    while (std::getline(file, line)) {
        std::istringstream iss(line);
        std::string wordInLine;
        while (iss >> wordInLine) {
            // Remove punctuation from the word and compare with the given word
            for (char& c : wordInLine) {
                c = std::tolower(c); // Convert to lowercase
                if (!std::isalnum(c)) {
                    wordInLine.erase(wordInLine.find(c)); // Remove non-alphanumeric characters
                }
            }
            // Compare the cleaned word with the given word
            if (wordInLine == word) {
                occurrences++;
            }
        }
    }
    file.close(); // Close the file to free up system resources
    return occurrences; // Return the count
}

int main() {
    // Get the word and filename from the user
    std::string word, filename;
    std::cout << "Enter the word to search for: ";
    std::cin >> word;
    std::cout << "Enter the filename: ";
    std::cin.ignore(); // Ignore the newline character left in the input buffer
    std::getline(std::cin, filename);

    int occurrences = countWordOccurrence(word, filename);
    if (occurrences == -1) {
        return 1; // Return non-zero exit code to indicate an error
    }

    std::cout << "The word '" << word << "' occurred " << occurrences << " times in the file." << std::endl;

    return 0;
}
```

This code does the following:

1.  Prompts the user to enter the word to search for and the filename.
2.  Reads the file line by line and counts the occurrences of the given word.
3.  Removes punctuation from each word in the file to ensure accurate counting.
4.  Compares the cleaned word with the given word to count the occurrences.
5.  Closes the file to free up system resources after counting the occurrences.
6.  Prints the count to the console.
